const e=JSON.parse('{"key":"v-a513a390","path":"/zh/guide/markdown/advanced/mermaid.html","title":"Mermaid","lang":"zh-CN","frontmatter":{"title":"Mermaid","icon":"pie-chart","head":[["meta",{"name":"og:url","content":"/zh/guide/markdown/advanced/mermaid.html"}],["meta",{"name":"og:site_name","content":"vuepress-theme-star"}],["meta",{"name":"og:title","content":"Mermaid"}],["meta",{"name":"og:description","content":""}],["meta",{"name":"og:type","content":"article"}],["meta",{"name":"og:image","content":""}],["meta",{"name":"og:updated_time","content":"2022-10-22T08:40:46.000Z"}],["meta",{"name":"og:locale","content":"zh-CN"}],["meta",{"name":"og:locale:alternate","content":"en-US"}],["meta",{"name":"og:locale:alternate","content":"zh-CN"}],["meta",{"name":"twitter:card","content":"summary_large_image"}],["meta",{"name":"twitter:image:alt","content":"vuepress-theme-star"}],["meta",{"name":"article:author","content":""}],["meta",{"name":"article:published_time","content":""}],["meta",{"name":"article:modified_time","content":"2022-10-22T08:40:46.000Z"}]]},"excerpt":"<h1 id=\\"mermaid\\" tabindex=\\"-1\\"><a class=\\"header-anchor\\" href=\\"#mermaid\\" aria-hidden=\\"true\\">#</a> Mermaid</h1>\\n<p>让你的 VuePress 站点中的 Markdown 文件支持 <a href=\\"https://mermaid-js.github.io/mermaid/#/\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">mermaid<ExternalLinkIcon/></a>。</p>\\n<p>使用 <a href=\\"https://mermaid-js.github.io/mermaid/#/\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">mermaid<ExternalLinkIcon/></a> 提供相应功能。</p>\\n","headers":[{"level":2,"title":"文档","slug":"文档","link":"#文档","children":[]},{"level":2,"title":"语法","slug":"语法","link":"#语法","children":[]},{"level":2,"title":"示例","slug":"示例","link":"#示例","children":[{"level":3,"title":"Flowchart","slug":"flowchart","link":"#flowchart","children":[]},{"level":3,"title":"Sequence Diagram","slug":"sequence-diagram","link":"#sequence-diagram","children":[]},{"level":3,"title":"Class Diagram","slug":"class-diagram","link":"#class-diagram","children":[]},{"level":3,"title":"State Diagram","slug":"state-diagram","link":"#state-diagram","children":[]},{"level":3,"title":"Entity Relationship Diagrams","slug":"entity-relationship-diagrams","link":"#entity-relationship-diagrams","children":[]},{"level":3,"title":"User Journey Diagram","slug":"user-journey-diagram","link":"#user-journey-diagram","children":[]},{"level":3,"title":"Gantt diagrams","slug":"gantt-diagrams","link":"#gantt-diagrams","children":[]},{"level":3,"title":"Pie chart diagrams","slug":"pie-chart-diagrams","link":"#pie-chart-diagrams","children":[]},{"level":3,"title":"A complex example","slug":"a-complex-example","link":"#a-complex-example","children":[]}]}],"git":{"createdTime":1664110816000,"updatedTime":1666428046000,"contributors":[{"name":"shentuzhigang","email":"shentuzhigang01@weidian.com","commits":6}]},"copyright":"Copyright © 2021-present Starzkg","filePathRelative":"zh/guide/markdown/advanced/mermaid.md","content":"---\\ntitle: Mermaid\\nicon: pie-chart\\n---\\n\\n# Mermaid\\n让你的 VuePress 站点中的 Markdown 文件支持 [mermaid](https://mermaid-js.github.io/mermaid/#/)。\\n\\n使用 [mermaid](https://mermaid-js.github.io/mermaid/#/) 提供相应功能。\\n\\n<!-- more -->\\n\\n## 文档\\n\\n相关详情，详见 [mermaid](https://mermaid-js.github.io/mermaid/#/).\\n\\n## 语法\\n\\n````md\\n```mermaid\\n\\n<!-- Your mermaid code here. -->\\n\\n```\\n````\\n\\n## 示例\\n\\n### Flowchart\\n\\n```mermaid\\nflowchart TB\\n    c1-->a2\\n    subgraph one\\n    a1-->a2\\n    end\\n    subgraph two\\n    b1-->b2\\n    end\\n    subgraph three\\n    c1-->c2\\n    end\\n    one --> two\\n    three --> two\\n    two --> c2\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\nflowchart TB\\n    c1-->a2\\n    subgraph one\\n    a1-->a2\\n    end\\n    subgraph two\\n    b1-->b2\\n    end\\n    subgraph three\\n    c1-->c2\\n    end\\n    one --> two\\n    three --> two\\n    two --> c2\\n```\\n````\\n\\n:::\\n\\n### Sequence Diagram\\n\\n```mermaid\\nsequenceDiagram\\n  Alice ->> Bob: Hello Bob, how are you?\\n  Bob-->>John: How about you John?\\n  Bob--x Alice: I am good thanks!\\n  Bob-x John: I am good thanks!\\n  Note right of John: Bob thinks a long<br/>long time, so long<br/>that the text does<br/>not fit on a row.\\n  \\n  Bob-->Alice: Checking with John...\\n  Alice->John: Yes... John, how are you?\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\nsequenceDiagram\\nAlice ->> Bob: Hello Bob, how are you?\\nBob-->>John: How about you John?\\nBob--x Alice: I am good thanks!\\nBob-x John: I am good thanks!\\nNote right of John: Bob thinks a long<br/>long time, so long<br/>that the text does<br/>not fit on a row.\\n\\nBob-->Alice: Checking with John...\\nAlice->John: Yes... John, how are you?\\n```\\n````\\n\\n:::\\n\\n### Class Diagram\\n\\n```mermaid\\nclassDiagram\\nclass Square~Shape~{\\n    int id\\n    List~int~ position\\n    setPoints(List~int~ points)\\n    getPoints() List~int~\\n}\\n\\nSquare : -List~string~ messages\\nSquare : +setMessages(List~string~ messages)\\nSquare : +getMessages() List~string~\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\nclassDiagram\\nclass Square~Shape~{\\n    int id\\n    List~int~ position\\n    setPoints(List~int~ points)\\n    getPoints() List~int~\\n}\\n\\nSquare : -List~string~ messages\\nSquare : +setMessages(List~string~ messages)\\nSquare : +getMessages() List~string~\\n```\\n````\\n\\n:::\\n\\n### State Diagram\\n\\n```mermaid\\nstateDiagram\\n[*] --> Active\\n\\nstate Active {\\n    [*] --> NumLockOff\\n    NumLockOff --> NumLockOn : EvNumLockPressed\\n    NumLockOn --> NumLockOff : EvNumLockPressed\\n    --\\n    [*] --> CapsLockOff\\n    CapsLockOff --> CapsLockOn : EvCapsLockPressed\\n    CapsLockOn --> CapsLockOff : EvCapsLockPressed\\n    --\\n    [*] --> ScrollLockOff\\n    ScrollLockOff --> ScrollLockOn : EvScrollLockPressed\\n    ScrollLockOn --> ScrollLockOff : EvScrollLockPressed\\n}\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\nstateDiagram\\n[*] --> Active\\n\\nstate Active {\\n    [*] --> NumLockOff\\n    NumLockOff --> NumLockOn : EvNumLockPressed\\n    NumLockOn --> NumLockOff : EvNumLockPressed\\n    --\\n    [*] --> CapsLockOff\\n    CapsLockOff --> CapsLockOn : EvCapsLockPressed\\n    CapsLockOn --> CapsLockOff : EvCapsLockPressed\\n    --\\n    [*] --> ScrollLockOff\\n    ScrollLockOff --> ScrollLockOn : EvScrollLockPressed\\n    ScrollLockOn --> ScrollLockOff : EvScrollLockPressed\\n}\\n```\\n````\\n\\n:::\\n\\n### Entity Relationship Diagrams\\n\\n```mermaid\\nerDiagram\\nCAR ||--o{ NAMED-DRIVER : allows\\nCAR {\\n    string registrationNumber\\n    string make\\n    string model\\n}\\nPERSON ||--o{ NAMED-DRIVER : is\\nPERSON {\\n    string firstName\\n    string lastName\\n    int age\\n}\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\nerDiagram\\n  CAR ||--o{ NAMED-DRIVER : allows\\n  CAR {\\n      string registrationNumber\\n      string make\\n      string model\\n  }\\n  PERSON ||--o{ NAMED-DRIVER : is\\n  PERSON {\\n      string firstName\\n      string lastName\\n      int age\\n  }\\n```\\n````\\n\\n:::\\n\\n### User Journey Diagram\\n\\n```mermaid\\njourney\\ntitle My working day\\nsection Go to work\\n  Make tea: 5: Me\\n  Go upstairs: 3: Me\\n  Do work: 1: Me, Cat\\nsection Go home\\n  Go downstairs: 5: Me\\n  Sit down: 5: Me\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\njourney\\ntitle My working day\\nsection Go to work\\n  Make tea: 5: Me\\n  Go upstairs: 3: Me\\n  Do work: 1: Me, Cat\\nsection Go home\\n  Go downstairs: 5: Me\\n  Sit down: 5: Me\\n```\\n````\\n\\n:::\\n\\n### Gantt diagrams\\n\\n```mermaid\\ngantt\\ndateFormat  YYYY-MM-DD\\ntitle       Adding GANTT diagram functionality to mermaid\\nexcludes    weekends\\n%% (`excludes` accepts specific dates in YYYY-MM-DD format, days of the week (\\"sunday\\") or \\"weekends\\", but not the word \\"weekdays\\".)\\n\\nsection A section\\nCompleted task            :done,    des1, 2014-01-06,2014-01-08\\nActive task               :active,  des2, 2014-01-09, 3d\\nFuture task               :         des3, after des2, 5d\\nFuture task2              :         des4, after des3, 5d\\n\\nsection Critical tasks\\nCompleted task in the critical line :crit, done, 2014-01-06,24h\\nImplement parser and jison          :crit, done, after des1, 2d\\nCreate tests for parser             :crit, active, 3d\\nFuture task in critical line        :crit, 5d\\nCreate tests for renderer           :2d\\nAdd to mermaid                      :1d\\n\\nsection Documentation\\nDescribe gantt syntax               :active, a1, after des1, 3d\\nAdd gantt diagram to demo page      :after a1  , 20h\\nAdd another diagram to demo page    :doc1, after a1  , 48h\\n\\nsection Last section\\nDescribe gantt syntax               :after doc1, 3d\\nAdd gantt diagram to demo page      :20h\\nAdd another diagram to demo page    :48h\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\ngantt\\ndateFormat  YYYY-MM-DD\\ntitle       Adding GANTT diagram functionality to mermaid\\nexcludes    weekends\\n%% (`excludes` accepts specific dates in YYYY-MM-DD format, days of the week (\\"sunday\\") or \\"weekends\\", but not the word \\"weekdays\\".)\\n\\nsection A section\\nCompleted task            :done,    des1, 2014-01-06,2014-01-08\\nActive task               :active,  des2, 2014-01-09, 3d\\nFuture task               :         des3, after des2, 5d\\nFuture task2              :         des4, after des3, 5d\\n\\nsection Critical tasks\\nCompleted task in the critical line :crit, done, 2014-01-06,24h\\nImplement parser and jison          :crit, done, after des1, 2d\\nCreate tests for parser             :crit, active, 3d\\nFuture task in critical line        :crit, 5d\\nCreate tests for renderer           :2d\\nAdd to mermaid                      :1d\\n\\nsection Documentation\\nDescribe gantt syntax               :active, a1, after des1, 3d\\nAdd gantt diagram to demo page      :after a1  , 20h\\nAdd another diagram to demo page    :doc1, after a1  , 48h\\n\\nsection Last section\\nDescribe gantt syntax               :after doc1, 3d\\nAdd gantt diagram to demo page      :20h\\nAdd another diagram to demo page    :48h\\n```\\n````\\n\\n:::\\n\\n### Pie chart diagrams\\n\\n```mermaid\\npie\\ntitle What Voldemort doesn\'t have?\\n  \\"FRIENDS\\" : 2\\n  \\"FAMILY\\" : 3\\n  \\"NOSE\\" : 45\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\npie\\ntitle What Voldemort doesn\'t have?\\n  \\"FRIENDS\\" : 2\\n  \\"FAMILY\\" : 3\\n  \\"NOSE\\" : 45\\n```\\n````\\n\\n:::\\n\\n### A complex example\\n\\n```mermaid\\ngraph TB\\n    sq[Square shape] --> ci((Circle shape))\\n\\n    subgraph A\\n        od>Odd shape]-- Two line<br/>edge comment --> ro\\n        di{Diamond with <br/> line break} -.-> ro(Rounded<br>square<br>shape)\\n        di==>ro2(Rounded square shape)\\n    end\\n\\n    %% Notice that no text in shape are added here instead that is appended further down\\n    e --> od3>Really long text with linebreak<br>in an Odd shape]\\n\\n    %% Comments after double percent signs\\n    e((Inner / circle<br>and some odd <br>special characters)) --> f(,.?!+-*ز)\\n\\n    cyr[Cyrillic]-->cyr2((Circle shape Начало));\\n\\n     classDef green fill:#9f6,stroke:#333,stroke-width:2px;\\n     classDef orange fill:#f96,stroke:#333,stroke-width:4px;\\n     class sq,e green\\n     class di orange\\n```\\n\\n::: details Code\\n\\n````md\\n```mermaid\\ngraph TB\\n    sq[Square shape] --> ci((Circle shape))\\n\\n    subgraph A\\n        od>Odd shape]-- Two line<br/>edge comment --> ro\\n        di{Diamond with <br/> line break} -.-> ro(Rounded<br>square<br>shape)\\n        di==>ro2(Rounded square shape)\\n    end\\n\\n    %% Notice that no text in shape are added here instead that is appended further down\\n    e --> od3>Really long text with linebreak<br>in an Odd shape]\\n\\n    %% Comments after double percent signs\\n    e((Inner / circle<br>and some odd <br>special characters)) --> f(,.?!+-*ز)\\n\\n    cyr[Cyrillic]-->cyr2((Circle shape Начало));\\n\\n     classDef green fill:#9f6,stroke:#333,stroke-width:2px;\\n     classDef orange fill:#f96,stroke:#333,stroke-width:4px;\\n     class sq,e green\\n     class di orange\\n```\\n````\\n\\n:::\\n","icon":"pie-chart","author":[{"name":"shentuzhigang","email":"shentuzhigang01@weidian.com"}],"top":false,"length":1110,"words":1110,"readingTime":3.7}');export{e as data};
